insert into agricultural_diagnosis.symptom (id, createdAt, updatedAt, description, diseaseId, imageUrl, stage)
values  (1, '2025-04-01 00:43:24.775000', '2025-04-17 20:19:47.711000', '叶片上形成褐色小点', 1, null, null),
        (2, '2025-04-01 00:43:24.778000', '2025-04-16 16:28:13.280000', '叶片上形成褐色小点，随后扩大成梭形斑', 1, null, null),
        (5, '2025-04-17 21:14:09.563000', '2025-04-17 21:14:09.563000', '初期产生红褐色小病斑，逐渐变成黑褐色，具同心轮纹。病斑扩大后，可使全果变成褐色，并软腐。病果失水后，皱缩，变成黑色僵果。其果皮下密生黑色小粒点，为病菌的分生孢子器[ty-reference](11)。', 3, null, null),
        (6, '2025-04-17 21:14:09.564000', '2025-04-17 21:14:09.564000', '枝干上病斑红褐色，湿润，不久扩大成暗褐色，形状不规整。以后干缩，凹陷，周围开裂，上面长出小黑点即病菌分生孢子器[ty-reference](11)。', 3, null, null),
        (13, '2025-04-25 22:57:52.931128', '2025-04-25 22:57:52.931128', '初期叶片上出现水渍状浅绿色斑点，随后扩展为褐色或黑褐色病斑，边缘不明显，病斑背面常有白色霉状物（孢子囊）。', 8, null, null),
        (14, '2025-04-25 22:57:52.932303', '2025-04-25 22:57:52.932303', '茎部感染后呈现深褐色至黑色病斑，病斑部位软腐，严重时导致植株折断或枯死。', 8, null, null),
        (15, '2025-04-25 22:57:52.933762', '2025-04-25 22:57:52.933762', '果实表面出现暗绿色水渍状病斑，逐渐变为暗褐色，病斑稍凹陷，边缘不规则，湿度大时表面产生白色霉层。', 8, null, null),
        (16, '2025-04-25 22:59:11.137652', '2025-04-25 22:59:11.137652', '初期叶片出现黄化现象，通常为不对称黄化，一侧绿色一侧黄色；后期叶片变小、硬化，呈现斑驳状。', 9, null, null),
        (17, '2025-04-25 22:59:11.138619', '2025-04-25 22:59:11.138619', '果实变小、畸形，果皮颜色不均匀，成熟期延迟，果肉干硬且味道变苦，俗称“红鼻子果”。', 9, null, null),
        (18, '2025-04-25 22:59:11.139547', '2025-04-25 22:59:11.139547', '病株生长缓慢，树势衰弱，枝条稀疏，最终导致整株死亡。', 9, null, null),
        (19, '2025-04-25 23:02:27.931000', '2025-04-25 23:02:27.931000', '初期叶片表面出现橙黄色小斑点，逐渐扩大形成圆形或不规则形病斑，边缘有黄绿色晕圈，病斑背面产生橘红色粉末状物，即锈孢子堆。', 10, null, null),
        (20, '2025-04-25 23:02:27.933000', '2025-04-25 23:02:27.933000', '果实上也会出现类似的橙黄色斑点，随着病情发展，病斑变硬并可能裂开，影响果实品质。', 10, null, null),
        (21, '2025-04-25 23:02:27.935000', '2025-04-25 23:02:27.935000', '枝条感染后可能出现肿胀、畸形，并伴有橘红色至褐色的冬孢子角。', 10, null, null),
        (22, '2025-04-25 23:04:51.645000', '2025-04-25 23:04:51.645000', '初期叶片上出现小水渍状斑点，随后发展成暗褐色至黑色不规则形斑点，边缘常有黄色晕圈。严重时病斑连片导致叶片枯死。', 11, null, null),
        (23, '2025-04-25 23:04:51.647000', '2025-04-25 23:04:51.647000', '茎部感染后形成深褐色条斑，有时会裂开或溃疡，影响水分运输，导致植株部分枯萎。', 11, null, null),
        (24, '2025-04-25 23:04:51.649000', '2025-04-25 23:04:51.649000', '果实表面出现小型、稍隆起的斑点，逐渐变为黑色且中心下陷，严重影响果实品质。', 11, null, null),
        (25, '2025-04-28 13:13:01.313000', '2025-04-28 13:13:01.313000', '叶片上出现小的圆形斑点，初期为水渍状，随着病情加重，斑点逐渐扩大并变为深褐色或黑色，斑点中央可能有裂口，严重时导致叶片枯死。', 12, null, null),
        (26, '2025-04-28 13:13:01.320000', '2025-04-28 13:13:01.320000', '茎部出现褐色至黑色的条斑，病斑逐渐扩大，导致茎部组织死亡，影响植物的营养和水分运输，严重时导致植株倒伏。', 12, null, null),
        (27, '2025-04-28 13:13:01.321000', '2025-04-28 13:13:01.321000', '果实表面形成深色凹陷的病斑，病斑中央呈现暗黑色，果实表面变软并逐渐腐烂，严重时导致果实死亡。', 12, null, null),
        (28, '2025-04-28 13:15:24.296000', '2025-04-28 13:15:24.296000', '叶片背面出现小的圆形或椭圆形黄褐色病斑，随着病情发展，病斑逐渐扩大，变为红色或橙色，最终导致叶片枯黄脱落。', 13, null, null),
        (29, '2025-04-28 13:15:24.298000', '2025-04-28 13:15:24.298000', '在茎部出现黄褐色或红色小斑点，病斑逐渐扩展并伴随表面裂开，严重时影响植株的生长和稳定性，可能导致茎部枯死。', 13, null, null),
        (30, '2025-04-28 13:15:24.301000', '2025-04-28 13:15:24.301000', '豆荚表面出现小的黄褐色病斑，病斑处的组织变薄，影响种子发育，导致种子发育不良甚至减少产量。', 13, null, null),
        (31, '2025-04-28 13:21:37.979000', '2025-04-28 13:21:37.979000', '叶片上出现不规则的黑色病斑，初期病斑呈灰绿色，随着病情加重，变为黑色并伴有黄色晕圈，病斑的中央可能出现裂口，严重时导致叶片早期脱落。', 14, null, null),
        (32, '2025-04-28 13:21:37.980000', '2025-04-28 13:21:37.980000', '果实表面形成小的黑色圆形病斑，病斑中央会出现凹陷，影响果实外观及品质，严重时导致果实腐烂。', 14, null, null),
        (33, '2025-04-28 13:21:37.982000', '2025-04-28 13:21:37.982000', '枝条上可见小型黑色病斑，随着时间推移，病斑逐渐扩大，影响树木的营养输送，严重时导致枝条死亡。', 14, null, null);